sys_script_include.script:
var AISSpokeUtilCustom = Class.create();
AISSpokeUtilCustom.prototype = {
    initialize: function() {
    },	
	isJson : function(json) {
        try {
            var str = json.toString();
            JSON.parse(str);
            return true;
        } catch (e) {
            return false;
        }
	},
    isNumber : function(size) {
        var number = parseInt(size);

        if (number) {
            return true;
        } else {
            return false;
        }
    },
    type: 'AISSpokeUtilCustom'
};
